export default (function(a,b,c,d,e,f){return {data:{OuZUAyRVjH:{data:{id:2064,attributes:{imdbId:"tt0396171",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTg2Mzk2NjkzNl5BMl5BanBnXkFtZTYwMzIzOTc2._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.5\u002F10"},{Source:"Rotten Tomatoes",Value:"59%"},{Source:"Metacritic",Value:"56\u002F100"}],item_lang:{data:{id:2727,attributes:{title:"Perfume: The Story of a Murderer",plot:"Jean-Baptiste Grenouille (Ben Whishaw) came into the world unwanted, expected to die, yet born with an unnerving sense of smell that created alienation, as well as talent. Of all of the smells around him, Grenouille is beckoned to the scent of a woman's body, and spends the rest of his life attempting to smell her essence again by becoming a perfumer, and creating the essence of an innocence lost.",slug:"perfume-the-story-of-a-murderer"}}},books:{data:[{id:10269,attributes:{title:d,description:"An odorless baby found orphaned in a Paris gutter in 1738 grows to become a monster obsessed with his perfect sense of smell and a desire to capture, by any means, the ultimate scent that will make him human. Reader's Guide available. Reprint. 20,000 first printing.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=7lwcURsKaUsC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2001-01-01",publisher:"Vintage",subtitle:e}},{id:10270,attributes:{title:d,description:"An acclaimed bestseller and international sensation, Patrick Suskind's classic novel provokes a terrifying examination of what happens when one man's indulgence in his greatest passion--his sense of smell--leads to murder. In the slums of eighteenth-century France, the infant Jean-Baptiste Grenouille is born with one sublime gift-an absolute sense of smell. As a boy, he lives to decipher the odors of Paris, and apprentices himself to a prominent perfumer who teaches him the ancient art of mixing precious oils and herbs. But Grenouille's genius is such that he is not satisfied to stop there, and he becomes obsessed with capturing the smells of objects such as brass doorknobs and frest-cut wood. Then one day he catches a hint of a scent that will drive him on an ever-more-terrifying quest to create the \"ultimate perfume\"--the scent of a beautiful young virgin. Told with dazzling narrative brillance, Perfume is a hauntingly powerful tale of murder and sensual depravity. Translated from the German by John E. Woods.",thumbnail:a,authors:[b],firstBook:c,published:"1987-01-01",publisher:a,subtitle:e}},{id:10271,attributes:{title:"El Perfume",description:"Survivor, genius, perfumer, killer: this is Jean-Baptiste Grenouille. He is abandoned on the filthy streets of Paris as a child, but grows up to discover he has an extraordinary gift: a sense of smell more powerful than any other human's. Soon, he is creating the most sublime fragrances in all the city. Yet there is one odour he cannot capture. It is exquisite, magical: the scent of a young virgin. And to get it he must kill. And kill. And kill. \"\"--Publisher description from http:\u002F\u002Fwww.penguin.co.uk (Sep. 30, 2011).",thumbnail:a,authors:[b],firstBook:c,published:"1992-08-01",publisher:"Penguin Books",subtitle:a}},{id:10272,attributes:{title:d,description:a,thumbnail:a,authors:[b],firstBook:c,published:f,publisher:a,subtitle:"A História de Um Assassino...Perfume - the Story of a Murderer"}},{id:10273,attributes:{title:"El perfume",description:"Quizá los olores evoquen el privilegio de la invisibilidad. Antes del tacto, sucede el olor, como mensajero de una esencia que sabe desaparecer en el aire y ser agente de un gran poder. La seducción que despliega el olor es implacable - se instala en nosotros y sella su poderío en los tejidos de la memoria. Jean-Baptiste Grenouille tiene su marca de nacimiento - no despide ningún olor. Al mismo tiempo posee un don excepcional - un olfato prodigioso que le permite percibir todos los olores del mundo. Desde la miseria en que nace, Grenouille lucha contra su condición y escala posiciones sociales convirtiéndose en un afamado perfumista. Crea perfumes capaces de hacerle inspirar simpatía, amor, compasión... Para obtener estas fórmulas magistrales debe asesinar a jóvenes muchachas vírgenes, obtener sus fluidos corporales y licuar sus olores íntimos. Su arte se convierte en una suprema e inquietante prestidigitación. Patrick Süskind nos transmite una visión ácida y desengañada del hombre y nos propone una inmersión literaria en el arco iris de los olores y en los abismos del espíritu humano. Convertida en una de las mayores producciones cinematográficas europeas de la historia, 'El perfume' es un libro repleto de sabiduría olfativa, imaginación y amenidad",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=EWLzSQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:f,publisher:"Planeta Publishing",subtitle:"historia de un asesino"}}]}}},meta:{}}},prerenderedAt:1680940944291}}("","Patrick Süskind",null,"Perfume","The Story of a Murderer","2006-01-01"))